import React from 'react';
import { Button, Dialog, DialogContent, DialogActions } from 'react-mdl';

class LIButton extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleOpenDialog = this.handleOpenDialog.bind(this);
    this.handleCloseDialog = this.handleCloseDialog.bind(this);
  }

  handleOpenDialog() {
    this.setState({
      openDialog: true
    });
  }

  handleCloseDialog() {
    this.setState({
      openDialog: false
    });
  }

  render() {
    return (
      <div>
        <Button
          style={{
            textAlign: 'justify',
            color: 'white',
            fontFamily: 'Righteous'
          }}
          href='https://www.linkedin.com/in/chambers91/'
          rel='noopener noreferrer'
          target='_blank'
          className='linkedin'
          raised
          ripple
        >
          LinkedIn
        </Button>
      </div>
    );
  }
}

export default LIButton;
